public class OriginEndpointFactory(string resourceName = null, Action<Humidifier.MediaPackageV2.OriginEndpoint> factoryAction = null) : ResourceFactory<Humidifier.MediaPackageV2.OriginEndpoint>(resourceName)
{

    internal List<InnerOriginEndpointLowLatencyHlsManifestConfigurationFactory> LowLatencyHlsManifestsFactories { get; set; } = [];

    internal List<InnerOriginEndpointHlsManifestConfigurationFactory> HlsManifestsFactories { get; set; } = [];

    internal List<InnerOriginEndpointDashManifestConfigurationFactory> DashManifestsFactories { get; set; } = [];

    internal InnerOriginEndpointForceEndpointErrorConfigurationFactory ForceEndpointErrorConfigurationFactory { get; set; }

    internal InnerOriginEndpointSegmentFactory SegmentFactory { get; set; }

    protected override Humidifier.MediaPackageV2.OriginEndpoint Create()
    {
        var originEndpointResult = CreateOriginEndpoint();
        factoryAction?.Invoke(originEndpointResult);

        return originEndpointResult;
    }

    private Humidifier.MediaPackageV2.OriginEndpoint CreateOriginEndpoint()
    {
        var originEndpointResult = new Humidifier.MediaPackageV2.OriginEndpoint
        {
            GivenName = InputResourceName,
        };

        return originEndpointResult;
    }
    public override void CreateChildren(Humidifier.MediaPackageV2.OriginEndpoint result)
    {
        base.CreateChildren(result);

        result.LowLatencyHlsManifests = LowLatencyHlsManifestsFactories.Any() ? LowLatencyHlsManifestsFactories.Select(x => x.Build()).ToList() : null;
        result.HlsManifests = HlsManifestsFactories.Any() ? HlsManifestsFactories.Select(x => x.Build()).ToList() : null;
        result.DashManifests = DashManifestsFactories.Any() ? DashManifestsFactories.Select(x => x.Build()).ToList() : null;
        result.ForceEndpointErrorConfiguration ??= ForceEndpointErrorConfigurationFactory?.Build();
        result.Segment ??= SegmentFactory?.Build();
    }

} // End Of Class

